import classes from "./FilteredUsers.module.css";
import { FaMapMarker } from "react-icons/fa";
import { FaEnvelope } from "react-icons/fa";

const FilteredUsers = (props) => {
  return (
    <li>
      <div className={classes.wrapper}>
        <aside className={`${classes.aside} ${classes["aside1"]}`}>
          <img
            className={classes.fakeimg}
            src={props.profilepic}
            alt={props.name}
          />
        </aside>

        <article className={classes.main}>
          <a href={props.url} target="_blank">
            {props.username}
          </a>

          <h4>{props.name}</h4>

          <h5>{props.bio}</h5>
        </article>

        <article className={classes.main}>
          <h5>
            {" "}
            <FaMapMarker />
            {props.location}
          </h5>

          <h5>
            <FaEnvelope />
            {props.username}@gmail.com
          </h5>
        </article>
      </div>
    </li>
  );
};

export default FilteredUsers;
